jobDescription:
Vérification des dispositifs FPGA (DAL A et B) suivant la norme DO-254 pour les systèmes électriques d'avion et participation  à la validation de différentes étapes de cycle de développement pour des systèmes avioniques. Développement des scénarios de test modulaire et top level en VHDL en suivant le cycle en V.

• Réaliser les plans de test selon les exigences d'entrée;
• Valider les documents d'entrée et de sortie: PLDRD, PLDDD, PLDVTP, Testbench;
• Développer les scripts de test en VHDL;
• Effectuer les simulations fonctionnelles sous ModelSim;
• Débogage et analyse des résultats;
• Remplissage de résultats.
